import React from 'react';

const TestLanguageSelector = () => {
    console.log('TestLanguageSelector rendering');
    
    return (
        <div style={{ 
            background: 'red', 
            color: 'white', 
            padding: '10px', 
            margin: '10px',
            border: '2px solid yellow'
        }}>
            TEST LANGUAGE SELECTOR
        </div>
    );
};

export default TestLanguageSelector;
